import './App.css';

const FormLog=()=> {
  return(
    <>
  <form action="#">
  <input type="password" placeholder="Password" /> <br/>
  <input type="submit"  value="submit"/>
  </form>
  </>);
}

function App() {
  return (
    <div className="App">
         <FormLog />
    </div>
  );
}

export default App;
